import { BrowserRouter, Routes } from 'react-router-dom';
import './App.css';
import UserList from './UserList';

function App() {
  return (
    <div className="App">
      <h3>React JS CRUD application</h3>
      <UserList/>
    </div>
  );
  <BrowserRouter>
    <Routes>
      <Route path='/userslist' element={UserList}></Route>
    </Routes>
  </BrowserRouter>
}

export default App;
